@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns the name of the pet type when pet type has a non-null name")
	void testPrintWithValidPetTypeReturnsName() {
		PetType petType = new PetType();
		petType.setName("Dog");
		var result = petType.print(new PetType(), Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
        @DisplayName("Returns "<null>" when pet type name is null")
        void testPrintWithNullNameReturnsNullString() {
            PetType petType = new PetType();
            petType.setName(null);
            var result = petType.print(new PetType(), Locale.ENGLISH);
            assertEquals("<null>", result);
        }

	@Test
	@DisplayName("Returns empty string when pet type name is empty")
	void testPrintWithEmptyNameReturnsEmptyString() {
		PetType petType = new PetType();
		petType.setName("");
		var result = petType.print(new PetType(), Locale.FRENCH);
		assertEquals("", result);
	}

	@Test
	@DisplayName("Returns the PetType object when the provided text matches the name of a PetType in the repository")
	void testParseReturnsPetTypeWhenNameMatches() {
		PetType petType = new PetType();
		petType.setName("dog");
		List<PetType> petTypes = List.of(petType);
		when(petTypeRepository.findPetTypes()).thenReturn(petTypes);
		var result = petType.parse("dog", Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws ParseException when the provided text does not match any PetType name in the repository")
	void testParseThrowsParseExceptionWhenNoMatchingPetType() {
		when(petTypeRepository.findPetTypes()).thenReturn(Collections.emptyList());
		assertThrows(ParseException.class, () -> {
			instance.parse("nonexistent", Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Throws ParseException when text is null")
	void testParseThrowsParseExceptionWhenTextIsNull() {
		when(petTypeRepository.findPetTypes()).thenReturn(Collections.emptyList());
		assertThrows(ParseException.class, () -> {
			instance.parse(null, Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Throws ParseException when text is an empty string")
	void testParseThrowsParseExceptionWhenTextIsEmpty() {
		when(petTypeRepository.findPetTypes()).thenReturn(Collections.emptyList());
		assertThrows(ParseException.class, () -> {
			instance.parse("", Locale.ENGLISH);
		});
	}

}
